INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (1, 0.0, 2002, 2, "2023/09/22 14:59:59", 10004, 0.0, 1, -470.0, "ライラエル", "2023/06/30 12:00:00", 1, 126501, "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (2, 0.0, 2002, 1, "2023/12/22 14:59:59", 10005, 0.0, 2, -470.0, "リンド", "2023/09/15 15:00:00", 2, 127702, "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (2, 0.0, 2002, 2, "2023/12/22 14:59:59", 10006, 0.0, 2, -470.0, "リンド", "2023/09/15 15:00:00", 2, 127702, "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (1, 0.0, 2002, 1, "2023/12/22 14:59:59", 10007, 0.0, 2, -470.0, "ヴルム", "2023/09/15 15:00:00", 1, 127802, "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (1, 6.5, 2002, 2, "2023/12/22 14:59:59", 10008, 0.0, 2, -470.0, "ヴルム", "2023/09/15 15:00:00", 2, 127802, "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (1, 0.0, 2002, 1, "2024/03/22 14:59:59", 10009, 0.0, 3, -470.0, "アネモネ", "2023/12/15 15:00:00", 2, 129602, "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (1, 0.0, 2002, 2, "2024/03/22 14:59:59", 10010, 0.0, 3, -470.0, "アネモネ", "2023/12/15 15:00:00", 2, 129602, "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (1, 0.0, 2002, 1, "2024/03/22 14:59:59", 10011, 0.0, 3, -470.0, "ネフィ=ネラ", "2023/12/15 15:00:00", 1, 129701, "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (1, 6.2, 2002, 2, "2024/03/22 14:59:59", 10012, 0.0, 3, -470.0, "ネフィ=ネラ", "2023/12/15 15:00:00", 2, 129701, "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (5, 3.1, 2002, 1, "2024/06/22 14:59:59", 10013, 0.0, 4, -470.0, "カノン", "2024/03/15 15:00:00", 3, 130301, "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (2, 6.15, 2002, 2, "2024/06/22 14:59:59", 10014, 0.0, 4, -470.0, "カノン", "2024/03/15 15:00:00", 3, 130301, "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (2, 0.0, 2002, 1, "2024/06/22 14:59:59", 10015, 0.0, 4, -470.0, "ナーナ", "2024/03/15 15:00:00", 2, 130401, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (1, 3.35, 2002, 2, "2024/06/22 14:59:59", 10016, 0.0, 4, -470.0, "ナーナ", "2024/03/15 15:00:00", 2, 130401, "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (1, 0.0, 2002, 1, "2024/09/22 14:59:59", 10017, 0.0, 5, -470.0, "ホウオウ", "2024/06/15 15:00:00", 1, 130502, "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (1, 3.18, 2002, 2, "2024/09/22 14:59:59", 10018, 0.0, 5, -470.0, "ホウオウ", "2024/06/15 15:00:00", 2, 130502, "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (4, 0.0, 2002, 3, "2024/09/22 14:59:59", 10019, 0.0, 5, -470.0, "ホウオウ", "2024/06/15 15:00:00", 4, 130503, "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (2, 4.9, 2002, 1, "2024/09/22 14:59:59", 10020, 0.0, 5, -470.0, "ネア", "2024/06/15 15:00:00", 1, 123301, "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (2, 4.8, 2002, 2, "2024/09/22 14:59:59", 10021, 0.0, 5, -470.0, "ネア", "2024/06/15 15:00:00", 1, 123301, "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (1, 4.922, 2002, 1, "2024/12/22 14:59:59", 10022, 0.0, 6, -470.0, "カリザ", "2024/09/15 15:00:00", 3, 133301, "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (5, 9.638, 2002, 2, "2024/12/22 14:59:59", 10023, 0.0, 6, -470.0, "カリザ", "2024/09/15 15:00:00", 3, 133301, "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (2, 2.88, 2002, 1, "2024/12/22 14:59:59", 10024, 0.0, 6, -470.0, "ミーア", "2024/09/15 15:00:00", 1, 133401, "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (1, 4.818, 2002, 2, "2024/12/22 14:59:59", 10025, 0.0, 6, -470.0, "ミーア", "2024/09/15 15:00:00", 5, 133401, "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (1, 1.78, 2002, 1, "2025/03/22 14:59:59", 10026, 0.0, 7, -470.0, "グレイス", "2024/12/15 15:00:00", 2, 133002, "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (7, 6.15, 2002, 2, "2025/03/22 14:59:59", 10027, 0.0, 7, -470.0, "グレイス", "2024/12/15 15:00:00", 1, 133002, "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (2, 4.28, 2002, 1, "2025/03/22 14:59:59", 10028, 0.0, 7, -470.0, "ヴァイオレット", "2024/12/15 15:00:00", 6, 133102, "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (1, 0.0, 2002, 2, "2025/03/22 14:59:59", 10029, 0.0, 7, -470.0, "ヴァイオレット", "2024/12/15 15:00:00", 1, 133102, "じめじめした商品は\nございませんので\n安心してお買い求め下さい");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (1, 5.53, 2002, 1, "2025/06/23 14:59:59", 10030, 0.0, 8, -470.0, "ルルィ", "2025/03/15 15:00:00", 2, 136902, "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (7, 6.05, 2002, 2, "2025/06/23 14:59:59", 10031, 0.0, 8, -470.0, "ルルィ", "2025/03/15 15:00:00", 9, 136902, "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (1, 0.0, 2002, 1, "2025/06/23 14:59:59", 10032, 0.0, 8, -470.0, "デュラン", "2025/03/15 15:00:00", 2, 137001, "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (1, 0.0, 2002, 2, "2025/06/23 14:59:59", 10033, 0.0, 8, -470.0, "デュラン", "2025/03/15 15:00:00", 2, 137001, "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (2, 0.0, 2002, 1, "2025/09/23 14:59:59", 10034, 0.0, 9, -470.0, "サツキ", "2025/06/16 15:00:00", 2, 135902, "おう\n好きなもん持ってきな");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (6, 4.935, 2002, 2, "2025/09/23 14:59:59", 10035, 0.0, 9, -470.0, "サツキ", "2025/06/16 15:00:00", 1, 135902, "宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (5, 7.441, 2002, 1, "2025/09/23 14:59:59", 10036, 0.0, 9, -470.0, "ユキノ", "2025/06/16 15:00:00", 2, 135802, "ら、ら、らっしゃっせ…\nなんかほしいもん、ある？\nか、かき氷とか、ど…？");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (7, 0.0, 2002, 2, "2025/09/23 14:59:59", 10037, 0.0, 9, -470.0, "ユキノ", "2025/06/16 15:00:00", 7, 135802, "そ、そんな見ねぇで…\nあては、売りもんじゃ\nねぇよ…？");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (2, 2.295, 2002, 1, "2025/12/23 14:59:59", 10038, 0.0, 10, -470.0, "クルル", "2025/09/16 15:00:00", 2, 130901, "クルルをお求めですかっ？\nそれならお礼に、こちらの\n宝石もどうぞですよ～♪");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (6, 6.281, 2002, 2, "2025/12/23 14:59:59", 10039, 0.0, 10, -470.0, "クルル", "2025/09/16 15:00:00", 1, 130901, "はっ！　ヒーローさんから\nお代なんて頂けないです！\nどうぞどうぞ…え、ダメ？");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (1, 5.549, 2002, 1, "2025/12/23 14:59:59", 10040, 0.0, 10, -470.0, "ヴォルガーノ", "2025/09/16 15:00:00", 2, 137701, "よぅ！　今日の俺さまは\n門番じゃなく、店番だぜ\nメモピ～スフィア～てな！");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (6, 2.64, 2002, 2, "2025/12/23 14:59:59", 10041, 0.0, 10, -470.0, "ヴォルガーノ", "2025/09/16 15:00:00", 3, 137701, "…リマさんのブロマイド？\n買い取るに決まってらぁ！\nなんでも持ってけ泥棒っ！");
